import React, {FC} from 'react';
import styled from 'styled-components'



export const AddIncomeButton = styled(ActionButton)`
  background: green;

`

export const AddExpenseButton = styled(ActionButton)`
background: red;
`

export const MainContent = styled.main`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  height: 100vh;
  width: 100vw;

`

export const ActionButtonsWrapper = styled.section`
position: fixed;
display: flex;
justify-content: space-between;
bottom: 1em;
right: 1em;
left: 1em;
`

const App: FC = () => {
 return (
 <MainContent>
  <h1>hello world</h1>
  <ActionButtonsWrapper>
    <AddExpenseButton>-</AddExpenseButton>
    <AddIncomeButton>+</AddIncomeButton>
  </ActionButtonsWrapper>
 </MainContent>
 )

}

export default App;
